import React from 'react';
import './Card.css';
import clubImage from './Images/club.png';

function Card(props){
    const cardInformation = props.name;
    return(
        <div className = "SingleCard">
          <p className = "CardNumber">{cardInformation}</p><img id = "CardSuit" src = {clubImage} alt = "Suit"></img>
        </div>
    )
}


export default Card;
